import React from "react";

function Tpo(){
    return <div className="whyus-container">
        <h1>Placement Cell</h1>
        <p>The aim of the Placement Cell is to provide good career opportunities to all the students of the institute. The department keeps close contact with potential employers and organises the campus placements for the students. About 100 leading companies from various premier industries participate in the placement process every year. The consistent positive feedback from industry shows that our students are successfully meeting their expectations for the professional roles assigned to them.</p>
        <p>Placement Cell is headed by Dr. Manoj Chopkar. He leads a dedicated team of student ‘Placement Conveners’ who are actively involved in the activities of the Placement Cell</p>
        <h1>Training Cell</h1>
        <p>The rapid technological advancement in industry has made the present-day campus placement of students challenging and competitive. The Training Cell endeavours to prepare the students to successfully overcome these challenges and enables them to grab the career opportunities by facilitating effective industry–institute interaction through various training programmes, workshops, expert lectures and seminars, making students employable and industry ready.</p>
        <p></p>
    </div>
}

export default Tpo;
